        </div>
        <img id="Welcome-Image"src="https://www.anno-expeditions.app/assets/sailing_ship_57972f3c-6d28-4cc8-a116-53a852eaff56-2-bde231d4.webp"></img>
    </div>
  );
}

export default Welcome;
